import React from 'react';

export default function NavBar({ onNav, selected }) {
  const tabs = [
    'Home', 'Key Generation', 'Encrypt All',
    'Sign All', 'History'
  ];
  return (
    <nav>
      {tabs.map(tab => (
        <button
          key={tab}
          onClick={() => onNav(tab)}
          style={{ margin: 4, fontWeight: selected === tab ? 'bold':'normal' }}
        >
          {tab}
        </button>
      ))}
    </nav>
  );
}
